window.bookSummaryJSON = "<p>Enemies are closing in, threatening those I love.</p> <p>You'd think witch hunts were a thing of the past, but it turns out, some dragons aren't happy with a witch living in their village.</p> <p>What's worse, my family can't seem to let me go, and I'm scared of how far they'll go to keep me from using my magic.</p> <p>If I have to leave Amber Bay to save my men from being hunted, then that's what I'll do. Even if my heart will break with every mile I put between us.</p> <p>But they won't let me go.</p> <p>They'll fight for me until their last breath, and I want nothing more than to stay with them.</p> <p>No matter what the future brings.</p>"; 
